import React from 'react';
import '../App.css'; 

function About() {
  return (
    <div className="page-container">
      <h1>About Us</h1>
      <p>This page will provide information about our application in Week 5.</p>
      <p>We aim to simplify your streaming experience.</p>
    </div>
  );
}

export default About;
